import { Link } from "react-router-dom";

export default function ProductsPage() {
    return (
        <>
            <h1>The Products Page</h1>
            <ul>
                <li><Link>Product 1</Link></li>
                <li><Link>Product 2</Link></li>
                <li><Link>Product 3</Link></li>
            </ul>
        </>
    );
}
